"use strict";

var pokedex = require("./pokedex.js").BattlePokedex;
var leransets = require("./learnsets.js").BattleLearnsets;
var rulesets = require("./rulesets.js").BattleFormats;
var movedex = require("./moves.js").BattleMovedex;
var toId = require("./translation.js").toId;
var toJa = require("./translation.js").toJa;
var superContest = require("./super_contest.js").SuperContest;

$(function () {
    // 卵技を追加する
    function addEggMoves(name, moves) {
        while (pokedex[name].prevo != null) {
            name = pokedex[name].prevo;
        }
        var learnset = leransets[name].learnset;
        for (var learn in learnset) {
            moves.push(toJa('move', learn));
        }
    }
    function validCategory(category) {
        var tag = "input#" + category;
        return $(tag).prop('checked');
    }
    $('input#submit').on('click', function () {
        var name = $('input#name').val();
        name = toId('pokemon', name);
        if (name == null) {
            alert("\"" + $('input#name').val() + "\" が見つかりません");
        }
        if (pokedex[name].baseSpecies != null) {
            name = pokedex[name].baseSpecies.toLowerCase().replace(/[^a-z0-9]+/g, '');
        }

        var learnset = leransets[name].learnset;
        var moves = [];
        for (var learn in learnset) {
            moves.push(toJa('move', learn));
        }
        addEggMoves(name, moves);

        moves.sort(function (a, b) {
            if (a < b) return -1;
            if (a > b) return 1;
            return 0;
        });

        // 重複している技を削除する
        moves = moves.filter(function (element, index, self) {
            return self.indexOf(element) === index;
        });

        $("table#moves tbody").html("");
        moves.forEach(function (move) {
            var id = toId('move', move);
            var row = "<tr>";
            row += "<td>" + move + "</td>";
            row += "<td>" + toJa('superContest', superContest[id].category) + "</td>";

            // row += "<td>" + toJa('type', movedex[id].type) + "</td>";
            // row += "<td>" + movedex[id].basePower + "</td>";
            row += "</tr>";

            if (validCategory(superContest[id].category)) {
                $("table#moves tbody").append(row);
            }
        }, this);
    });
});

